    <script>
        function updateCountdown() {
            const targetDate = new Date('2025-09-30');
            const currentDate = new Date();
            const timeDifference = targetDate - currentDate;
            const daysRemaining = Math.ceil(timeDifference / (1000 * 60 * 60 * 24));

            const countdownText = document.getElementById('countdownText');
            if (countdownText) {
                const tspanElement = countdownText.querySelector('tspan');
                if (tspanElement) {
                    tspanElement.textContent = `${daysRemaining} TAGE`;
                } else {
                    console.error('tspan element not found');
                }
            } else {
                console.error('Element with id countdownText not found');
            }
        }

        updateCountdown();
        setInterval(updateCountdown, 24 * 60 * 60 * 1000);
    </script>
